import React from 'react';
import './Footer.css';
const Footer = () => {
  return (
    <footer className="footer">
      <p>Designed by Meet Patel - I.T. Batch 2023-26 <br /> & Maintained By AIDS Dept., SCET, Surat</p>
    </footer>
  );
};

export default Footer;
